import React, { useState } from 'react';
import './App.css';
import ImageComponent from './ImageComponent';

function App() {
  const [userText, setUserText] = useState(["", "", "", "", "", "", ""]);

  function handleUserTextChange(index, newText) {
    const updatedUserText = [...userText];
    updatedUserText[index] = newText;
    setUserText(updatedUserText);
  }

  return (
    <div className="container">
      <div className="image-wrapper">
        <ImageComponent userText={userText} onUserTextChange={handleUserTextChange} />
      </div>
    </div>
  );
}

export default App;
